import React from 'react';
import JohnNguyenImg from './images/team/John-Nguyen.jpg';
import Christian from './images/team/Christian.jpg';
import Shane from './images/team/Shane.jpg'
const Team = () => {
  const style = {
    height: "200px",
    width: "200px",
    borderRadius: "50%"
  }
  return (
    <div className="container text-center">
      <h4 className="mb-5">Meet Our Team!</h4>
      <div className="row">
        <div className="col">
          <img src={Shane} alt="Shane" style={style}/>
        </div>
        <div className="col">
          <img src={Christian} alt="Christian"style={style}/>
        </div>
        <div className="col">
          <img src={JohnNguyenImg} alt="John Nguyen" style={style}/>
        </div>
      </div>
    </div>
  )
}

export default Team;
